import unittestfrom chengji import scoreclass TestScore(unittest.TestCase):    """我们用于测试Scroe的用例"""    def setUp(self):        print('setup')    def test_a(self):        print("test_01")        self.assertEqual(score(90),'A',msg="测试失败，预期结果是A，实际结果不是")    def test_b(self):        self.assertEqual(score(80), 'B', msg="测试失败，预期结果是B，实际结果不是")    def test_c(self):        self.assertEqual(score(70), 'C', msg="测试失败，预期结果是C，实际结果不是")    def test_d(self):        self.assertEqual(score(60), 'D', msg="测试失败，预期结果是D，实际结果不是")    def tearDown(self):        print('teardown')if __name__ == '__main__':    unittest.main()